    <div class="tween">
        <p>Data yang dikumpulkan dari laporan-laporan di media tentang penyitaan tenggiling dari 2011 dan September 2019 menunjukkan bahwa hampir 50 persen dari semua kasus penangkapan yang dilaporkan di Vietnam terjadi sepanjang jalan tol yang menghubungkan perbatasa Laos di Cau Treo dengan perbatasan Cina di Móng Cái. Ini berarti ada rute penyelundupan yang tetap.</p>
        <span id="tweenVietnam-1"></span>
    </div>
    <div class="tween" id="tweenVietnam-2">
        <p>Kedua kota perbatasan, Dongxing and Mong Cai, telah menjadi pusat penyelundupan tenggiling.Penduduk di kota-kota perbatasan ini bisa meminta izin khusus yang membolehkan mereka melewati perbatasan dengan pengecekan minimal. Penyelidikan menunjukkan bahwa hal ini seringkali memudahkan aktivitas penyelundupan</p>
